// import React from 'react';
import './App.css';
import Footer from './components/Footer';
import Main from './components/Main';
import Layout from './components/Layout';
import AppContext from './context/AppContext';

const person2 = {
  firstname: 'John',
  lastname: 'Doe'
};

function App() {
  return (
    <AppContext.Provider value={person2}>
      <Layout/>
      <Main>
        <h1>Hello</h1>
      </Main>
      <Footer/>
    </AppContext.Provider>
  );
}

export default App;
